function interact(i,j){


    var iType = i.enneagram[0];
    var jType = j.enneagram[0];
    
    var firstTime = false;
    
    if(!(i.knowledge.includes(j.name)&&j.knowledge.includes(i.name))){
        i.knowledge.push(j.name);
        j.knowledge.push(i.name);
        firstTime=true;
        i.boredom = i.boredom - 1;
        j.boredom = j.boredom - 1;

        // console.log(i.name + " just met " + j.name + " for the first time.")
    }
    
    if(enneagramCompat[iType-1].includes(jType)){
        if(firstTime){
            i.friends.push(j.name);
            j.friends.push(i.name);
        }
        // console.log(i.name + " is getting along with " + j.name)
        i.thoughts.push(i.name+" had a positive experience interacting with "+j.name);
        j.thoughts.push(j.name+" had a positive experience interacting with "+i.name);
        i.happiness = i.happiness + 2;
        j.happiness = j.happiness + 2;

        i.boredom = i.boredom - 2;
        j.boredom = j.boredom - 2;


    }
    else if(enneagramNonCompat[iType-1].includes(jType)){
        if(firstTime){
            i.enemies.push(j.name);
            j.enemies.push(i.name);
        }
        // console.log(i.name + " is annoyed by " + j.name)
        i.thoughts.push(i.name+" had a negative experience interacting with "+j.name);
        j.thoughts.push(j.name+" had a negative experience interacting with "+i.name);

        i.happiness = i.happiness - 3;
        j.happiness = j.happiness - 5;
        i.boredom = i.boredom - 1;
        j.boredom = j.boredom - 1;


    }
    else{
        // i.memories.push(i.name+" didn't feel anything after interacting with "+j.name);
        // j.memories.push(j.name+" didn't feel anything after interacting with "+i.name);
        i.boredom = i.boredom + 2;
        j.boredom = j.boredom + 1;


    }

    if(i.thoughts.length > 20){
        if(Math.floor(Math.random() * 1000)<2)
            i.memories.push(i.thoughts.shift());
        else
            i.thoughts.shift()
    }
    if(j.thoughts.length > 20){
        if(Math.floor(Math.random() * 1000)<2)
            j.memories.push(j.thoughts.shift());
        else
            j.thoughts.shift()
    }
}

var stop = false;


function genStep(){
    places[currentplace].residents.forEach(c => {
        interact(c, pickRandom(places[currentplace].residents));
        if(c.happiness<0||c.boredom>1000){
            // console.log(c);
            stop = true;
            nomad = c;
        }
    })
    currentStep++;
}


function genSim(steps){
    if(places.length < 1)
        newBase(null);
    for(var j = 0; j<steps; j++){
        if(stop){
            var index = places[currentplace].residents.indexOf(nomad);
            places[currentplace].residents.splice(index,1);
            newBase(nomad);

            stop = false;
        }
        else{
            genStep();
        }

    }
    
}

function findPlaceByName(placeName){
    for(var i = 0; i<places.length; i++){
        if(places[i].name === placeName){
            return i;
        }
    }

}

function cleanStep(residents){
    residents.forEach(c => {
        if(!stop){
            interact(c, pickRandom(residents));
            if(c.happiness<30||c.boredom>100){
                // console.log(c);
                nomad = c;
                stop = true;
            }
            else if(c.happiness>3000||c.boredom<-3000){
                // console.log(c);
                nomad = c;
                stop = true;
            }
        }
    }) 
}

function cleanSim(steps){
    stop = false;
    places.forEach(p=>{
        if(Math.random()<.22){
            var neighbor = pickRandom(places);
            if(p != neighbor && !p.neighbors.includes(neighbor)){
                p.neighbors.push(neighbor.name);
                neighbor.neighbors.push(p.name);

            }
        }

        for(var i = 0; i<steps; i++){
            if(stop){
                var newHome = pickRandom(p.neighbors)
                nomad.travels.push(newHome)
                nomad.boredom = 50;
                nomad.happiness = 50;

                places[findPlaceByName(newHome)].residents.push(nomad);
                var index = p.residents.indexOf(nomad);
                p.residents.splice(index, 1);
                stop = false;
            }
            cleanStep(p.residents)
        }
        graph.push(p.name)

        // console.log(p.name + " " + p.residents.length);
        

    })
}

