function generateMap(rooms,services){
    var myGrid = [...Array(Math.floor(rooms*2))].map(e => Array(Math.floor(rooms*2)));

    var roomCoords = [];
    var t = ["╔","═","╗","║"," ","║","╚","═","╝","╬","╩","╦"];
    for(var i = 0; i<rooms; i++){
        var x = Math.floor(((Math.random() * rooms/2) + rooms/2)/3)*3
        var y = Math.floor(((Math.random() * rooms/2) + rooms/2)/3)*3
        if(roomCoords.includes({x,y})){
            i--;
            console.log("Overlap")
        }
        else{
            roomCoords.push({x,y})
            if(myGrid[x][y] === undefined)
                myGrid[x][y] = (i<services.length) ? services[i] : " X";
            myGrid[x][y+1] = "║"
            myGrid[x][y-1] = "║"
            myGrid[x-1][y] = "══"

            myGrid[x-1][y-1] = "╔"
            myGrid[x-1][y+1] = "╗"

            myGrid[x+1][y] = "══"

            myGrid[x+1][y-1] = "╚"
            myGrid[x+1][y+1] = "╝"
        }




    }
    // console.log(roomCoords)

    for(var i =0; i<rooms*2; i++){
        var temp = myGrid[i]
        for(var j =0; j<rooms*2; j++){
            if(temp[j] === undefined)
                process.stdout.write((Math.floor(Math.random() * 7)===1)?".":" ");
            else
                process.stdout.write(temp[j]);
        }
        process.stdout.write("\n");

    }
    return myGrid;
}


